	function showSearch(num) {
		var player = "square";
		player += num;
		selectedPlayerSquare = player;
		var playerBox = document.getElementById(player);
		playerBox.style.backgroundColor = "#FFBF00";
		var search = document.getElementById("search");
		search.style.display = "inline-block"; 	
		var title = document.getElementById("title");
		title.style.display = "none";
		const divs = document.getElementsByTagName("div");
		for (div of divs){
			div.style.opacity = "0.5";
		}
		document.getElementById("searchBar").focus();
		document.getElementById("search").style.opacity = "1.0"
		document.getElementById("topNavBar").style.opacity = "1.0"; 	
		let body = document.body;
		body.addEventListener("click", closeSearch, true); // ANY OUTSIDE CLICK CLOSES SEARCH
				
	}

	function closeSearch() {
  		document.getElementById("search").style.display = "none";
  		document.getElementById("title").style.display = "block";
  		const divs = document.getElementsByTagName("div");
		for (div of divs){
			div.style.opacity = "1.0";
		}
		const boxes = document.getElementsByClassName("playerSquare");
		for (div of boxes){
			div.style.backgroundColor = "#757083";
		}
		event.preventDefault();
		document.getElementById('searchBar').value = '';
		let body = document.body;
		body.removeAttribute("onclick");
	}

	function selectPlayer(player){
		const boxes = document.getElementsByClassName("playerSquare");
		div = document.getElementById(selectedPlayerSquare); // PLAYER SQUARE SELECTED
		id = div.id;
		num = id.substring(6,7);
		if (num < 4){
			team = "team1";
		} else if (num <= 6){ 
			team = "team2";
		}
		else{
			team = "team3";
		}
		if (num == 1 || num == 4 || num == 7){
			jerseyNum = "jersey1";
		} else if (num == 2 || num == 5 || num == 8){
			jerseyNum = "jersey2";
		}
		else {
			jerseyNum = "jersey3";
		}

		let check = checkPlayer(player, team, jerseyNum);
		if (check){
			pText = document.createElement("div");
			pText.className = "playerText";
			pText.innerHTML += player; 
			div.appendChild(pText);
			div.className = "solidPlayer";
			div.style.backgroundColor = "#8fce00";
			div.removeAttribute("onclick");
			const startTag = 'https://cdn.nba.com/headshots/nba/latest/260x190/';
			const endTag = '.png';
			player = player.normalize("NFD").replace(/[\u0300-\u036f]/g, ""); // REMOVES ACCENTS
			let playerID = playerIDs[player];
			let headshot = startTag + playerID + endTag;
			addHeadshot(headshot, div);
			usedPlayers.push(player); // ADD PLAYER TO USED PLAYERS ARRAY
			checkWin();
		}
		document.getElementById('searchBar').value = '';
		closeSearch();
	}

	function addHeadshot(src, div){
		var elem = document.createElement("img");
		console.log()
		elem.src = src;
		elem.addEventListener("error", function(event) { // IF NO IMAGE USE BACKUP
  			event.target.src = "https://cdn.nba.com/headshots/nba/latest/260x190/fallback.png";
  			event.onerror = null;
		})
		elem.objectFit='none';
		div.appendChild(elem);
	}

